import {useContext} from 'react'
import {CityContext} from '../context/CityContext'

function Header() {
  const data = useContext(CityContext);
  console.log(data);
  return (
    <div className='header_container'>
      <select className="form-select form-select-lg mb-3" aria-label="Large select example">
        <option selected>Please select a city</option>
        <option value="1">İzmir</option>
        <option value="2">İstanbul</option>
        <option value="3">Ankara</option>
      </select>
    </div>
  )
}

export default Header
